var snapLinks=new function(){this.addClickListener=function(n){n.addEventListener("click",function(i){i.preventDefault(),fetch(i.target.href).then(function(n){n.text().then(function(n){var t=(new DOMParser).parseFromString(n,"text/xml"),e=window.snapSelectors.findTargets(t);null!=e&&0!==e.length||i.target.parentNode.replaceChild(t.documentElement,i.target)}).catch(function(n){})}).catch(function(n){})})}},snapSelectors=new function(){this.findForms=function(n){return n.querySelectorAll("form[data-snap]")},this.findLinks=function(n){return n.querySelectorAll("a[data-snap]")},this.findTargets=function(n){return n.querySelectorAll("[data-snap-target]")}},snap=new function(){this.load=function(){document.addEventListener("DOMContentLoaded",this.registerSnapElements(document.body))},this.registerSnapElements=function(n){for(var t=window.snapSelectors.findLinks(n),e=0,i=t.length;e<i;e++)window.snapLinks.addClickListener(t[e])}};window.snap.load();